var title_f42_21_43355="Doxorubicin cardiac monitoring";
var content_f42_21_43355=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F58738&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F58738&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Guidelines for monitoring cardiac function in patients receiving doxorubicin",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Perform baseline radionuclide angiocardiography at rest for calculation of left ventricular ejection fraction (LVEF) prior to administration of 100 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        doxorubicin.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Subsequent studies are performed at least three weeks after the indicated total cumulative doses have been given, before consideration of the next dose.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Patients with normal baseline LVEF (&ge;50 percent)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Perform a second study after 250 to 300 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        . Repeat study after 400 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        in patients with known heart disease, radiation exposure, abnormal electrocardiographic results, or cyclophosphamide therapy; or after 450 mg/m",
"        <sup>",
"         2",
"        </sup>",
"        in the absence of any these risk factors.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Perform sequential studies thereafter prior to each dose.&nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Discontinue doxorubicin therapy once functional criteria for cardiotoxicity develop, eg, absolute decrease in LVEF &ge;10 percent (EF Units) associated with a decline to a level of &le;50 percent (EF Units).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Patients with abnormal baseline LVEF (&le;50 percent)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Doxorubicin therapy should",
"        <strong>",
"         not",
"        </strong>",
"        be initiated with baseline LVEF &le;30 percent.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        In patients with LVEF &gt;30 percent and &lt;50 percent, sequential studies should be obtained prior to each dose.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Discontinue doxorubicin with cardiotoxicity: absolute decrease in LVEF &ge;10 percent (EF units) and/or final LVEF &le;30 percent.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     LVEF: left ventricular ejection fraction.",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Schwartz RG, McKenzie WB, Alexander J, et al. Am J Med 1987; 82:1109.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
