" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Frontal chest radiograph shows combined atelectasis of the right upper and middle lobes",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 363px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    An oval shadow obscures the right mediastinal contour, and displays a so-called elephant ear configuration (asterisk). The hyperlucent right lung apex is formed by hyperexpansion of the superior segment of the right lower lobe. Bilateral pleural effusions are present.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Paul Stark, MD.",
"    </div>",
